ble\\":true,\\"isFavourited\\":false,\\"isDeleted\\":false,\\"isMature\\":false,\\"isDownloadable\\":false,\\"isAntisocial\\":false,\\"isBlocked\\":false,\\"isPublished\\":true,\\"blockReason\\":null,\\"author\\":114790,\\"stats\\":{\\"comments\\":13,\\"favourites\\":1},\\"media\\":{\\"baseUri\\":\\"https:\\\\u002F\\\\u002Fimages-wixmp-ed30a86b8c4ca887773594c2.wixmp.com\\\\u002Fi\\\\u002F2b5a457d-dde7-459a-badf-774e8e506025\\\\u002Fd7f23-4a5b0c40-2aca-47de-8687-32423acc2235.jpg\\",\\"prettyName\\":\\"who_are_you___i_by_pachunka_d7f23\\",\\"types\\":[{\\"t\\":\\"preview\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_201,h_201,q_75,strp\\\\u002F\\\\u003CprettyName\\\\u003E-fullview.jpg\\",\\"h\\":201,\\"w\\":201,\\"f\\":7637},{\\"t\\":\\"social_preview\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_201,h_201,q_75,strp\\\\u002F\\\\u003CprettyName\\\\u003E-fullview.jpg\\",\\"h\\":201,\\"w\\":201}]},\\"textContent\\":{\\"excerpt\\":\\"I\'m up on the roof and I\'m lookin\' around,\\\\nThe rain\'s try\'na kill me, without makin\' a.\\\\n\\\\nPraise the lord!\\\\n\\\\nWho?\\\\n\\\\nThe lord.\\\\n\\\\nWhy?\\\\n\\\\n\'coz he\'s good.\\\\n\\\\nSo you praise \'im..\\\\n\\\\nWell, yeah.\\\\n\\\\nWhy?\\\\n\\\\n\'coz he\'s\\\\n\\\\nYer best friend\'s good.. you praise him?\\\\n\\\\nWell, no but\\\\n\\\\nWhy?\\\\n\\\\nThat\'d just be weird..\\\\n\\\\nWhy?\\\\n\\\\nI know it\'d be weird if he praised me..\\\\n\\\\nSo you don\'t praise him..\\\\n\\\\nYe\\\\n\\\\nDoesn\'t he deserve it?\\\\n\\\\nWell y\\\\n\\\\nYou really think the lord wants you to praise \'im?\\\\n\\\\n..\\\\n\\\\nDid he tell you so himself?\\\\n\\\\nThe bi\\\\n\\\\nDid he?\\\\n\\\\nNo..\\\\n\\\\n..\\\\n\\\\n..\\\\n\\\\nHe is pretty good tho\'\\\\n\\\\nWho?\\\\n\\\\nThe lord.\\\\n\\\\nYeah.\\\\n\\\\n..\\\\n\\\\nHe is.\\\\n\\\\n..\\\\n\\\\nWait a sec.. I\'m talkin\' to the rain..\\\\nSheddup rain..\\",\\"html\\":{\\"type\\":\\"writer\\",\\"features\\":\\"\\"}},\\"entityId\\":346107},\\"362487\\":{\\"deviationId\\":362487,\\"typeId\\":1,\\"printId\\":null,\\"url\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fpachunka\\\\u002Fart\\\\u002FThe-Streets-Near-Notre-Dame-362487\\",\\"title\\":\\"The Streets Near Notre Dame\\",\\"isJournal\\":false,\\"isPurchasable\\":false,\\"publishedTime\\":\\"2002-05-21T16:37:16-0700\\",\\"isTextEditable\\":false,\\"legacyTextEditUrl\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fdeviation\\\\u002Fedit\\\\u002F362487\\",\\"isShareable\\":true,\\"isCommentable\\":true,\\"isFavourited\\":false,\\"isDeleted\\":false,\\"isMature\\":false,\\"isDownloadable\\":false,\\"isAntisocial\\":false,\\"isBlocked\\":false,\\"isPublished\\":true,\\"blockReason\\":null,\\"author\\":114790,\\"stats\\":{\\"comments\\":18,\\"favourites\\":1},\\"media\\":{\\"baseUri\\":\\"https:\\\\u002F\\\\u002Fimages-wixmp-ed30a86b8c4ca887773594c2.wixmp.com\\\\u002Fi\\\\u002F2b5a457d-dde7-459a-badf-774e8e506025\\\\u002Fd7rp3-f380271c-94a3-44db-b493-474d2604d640.jpg\\",\\"prettyName\\":\\"the_streets_near_notre_dame_by_pachunka_d7rp3\\",\\"types\\":[{\\"t\\":\\"preview\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_201,h_201,q_75,strp\\\\u002F\\\\u003CprettyName\\\\u003E-fullview.jpg\\",\\"h\\":201,\\"w\\":201,\\"f\\":7637},{\\"t\\":\\"social_preview\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_201,h_201,q_75,strp\\\\u002F\\\\u003CprettyName\\\\u003E-fullview.jpg\\",\\"h\\":201,\\"w\\":201}]},\\"textContent\\":{\\"excerpt\\":\\"The Streets Near Notre Dame\\\\n\\\\n\'tis now daybreak, yet someday soon,\\\\nWise Sol will hush the zephyr\'s plan and\\\\nWe, shall walk \'neath sunny Noon,\\\\nAlong the river\'s hand..\\\\nWhere we will live,\\\\nWhere we will live,\\\\nOn the streets near Notre Dame.\\\\n\\\\nWith arms entwangled,\\\\nTrees for shade,\\\\nAnd all a foreign land..\\\\n\\\\nWith no more storms,\\\\nJust you and I,\\\\nAnd gracious Notre Dame.\\\\n\\\\nFor this I give,\\\\nAnd we will live,\\\\nOn the streets near Notre Dame.\\\\n\\\\nPach, 22nd day of Summer, MMII.\\",\\"html\\":{\\"type\\":\\"writer\\",\\"features\\":\\"\\"}},\\"entityId\\":362487},\\"394900\\":{\\"deviationId\\":394900,\\"typeId\\":1,\\"printId\\":null,\\"url\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fpachunka\\\\u002Fart\\\\u002FCommDev-TME-twilight-ashes-394900\\",\\"title\\":\\"CommDev TME twilight-ashes\\",\\"isJournal\\":false,\\"isPurchasable\\":false,\\"publishedTime\\":\\"2002-06-04T13:37:56-0700\\",\\"isTextEditable\\":false,\\"legacyTextEditUrl\\":null,\\"isShareable\\":false,\\"isCommentable\\":true,\\"isFavourited\\":false,\\"isDeleted\\":false,\\"isMature\\":false,\\"isDownloadable\\":true,\\"isAntisocial\\":false,\\"isBlocked\\":false,\\"isPublished\\":true,\\"blockReason\\":null,\\"author\\":114790,\\"stats\\":{\\"comments\\":7,\\"favourites\\":3},\\"media\\":{\\"baseUri\\":\\"https:\\\\u002F\\\\u002Fimages-wixmp-ed30a86b8c4ca887773594c2.wixmp.com\\\\u002Fi\\\\u002F2b5a457d-dde7-459a-badf-774e8e506025\\\\u002Fd8gpg-89ccb085-3b60-4ab4-b2a6-1bc0a8ac0ea5.jpg\\",\\"prettyName\\":\\"commdev_tme_twilight_ashes_by_pachunka_d8gpg\\",\\"types\\":[{\\"t\\":\\"150\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffit\\\\u002Fw_150,h_150,q_70,strp\\\\u002F\\\\u003CprettyName\\\\u003E-150.jpg\\",\\"h\\":150,\\"w\\":150},{\\"t\\":\\"200H\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_200,h_200,q_70,strp\\\\u002F\\\\u003CprettyName\\\\u003E-200h.jpg\\",\\"h\\":200,\\"w\\":200},{\\"t\\":\\"300W\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_201,h_201,q_75,strp\\\\u002F\\\\u003CprettyName\\\\u003E-fullview.jpg\\",\\"h\\":201,\\"w\\":201},{\\"t\\":\\"250T\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_201,h_201,q_75,strp\\\\u002F\\\\u003CprettyName\\\\u003E-fullview.jpg\\",\\"h\\":201,\\"w\\":201},{\\"t\\":\\"350T\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_201,h_201,q_75,strp\\\\u002F\\\\u003CprettyName\\\\u003E-fullview.jpg\\",\\"h\\":201,\\"w\\":201},{\\"t\\":\\"400T\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u