"Tea Stain\\\\n\\\\n\\\\\\"You call this bollage toast, man?\\\\nIt\'s nowhere near done fully..\\\\nThe middle bit\'s all burned\'n\'weird,\\\\nThe outside bit is fluffy.\\\\\\"\\\\n\\\\nThe toaster\'s broken inside,\\\\nAnd outside stands a goat..\\\\nAnd I am citing to the moon,\\\\nMy tea stained suicide note.\\\\n\\\\n\\\\\\"I can\'t believe I\'m eating this.\\\\\\"\\\\nI do wish he\'d shut up..\\\\nIn fact I\'d wish this all away-\\\\nThis blasted tea stained cup..\\\\n\\\\nSo many must have pondered it;\\\\nTo leave it all and fly..\\\\nFly to the moon ne\'er looking back,\\\\nAnd let the morning die..\\\\n\\\\nYet, this cup\'s a might addictive,\\\\nAnd shalln\'t let me forget..\\\\nYet seems my tea stained suicide,\\\\nHas not subsided yet..\\\\n\\\\nAnd so, th\\",\\"html\\":{\\"type\\":\\"writer\\",\\"features\\":\\"\\"}},\\"entityId\\":450639},\\"468568\\":{\\"deviationId\\":468568,\\"typeId\\":1,\\"printId\\":null,\\"url\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fpachunka\\\\u002Fart\\\\u002FWillow000-Epiphany-468568\\",\\"title\\":\\"Willow000- Epiphany\\",\\"isJournal\\":false,\\"isPurchasable\\":false,\\"publishedTime\\":\\"2002-07-01T11:35:45-0700\\",\\"isTextEditable\\":false,\\"legacyTextEditUrl\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fdeviation\\\\u002Fedit\\\\u002F468568\\",\\"isShareable\\":true,\\"isCommentable\\":true,\\"isFavourited\\":false,\\"isDeleted\\":false,\\"isMature\\":false,\\"isDownloadable\\":false,\\"isAntisocial\\":false,\\"isBlocked\\":false,\\"isPublished\\":true,\\"blockReason\\":null,\\"author\\":114790,\\"stats\\":{\\"comments\\":5,\\"favourites\\":1},\\"media\\":{\\"baseUri\\":\\"https:\\\\u002F\\\\u002Fimages-wixmp-ed30a86b8c4ca887773594c2.wixmp.com\\\\u002Fi\\\\u002F2b5a457d-dde7-459a-badf-774e8e506025\\\\u002Fda1js-8ac3aecd-07d5-4872-b93a-261baf7e24bf.jpg\\",\\"prettyName\\":\\"willow000__epiphany_by_pachunka_da1js\\",\\"types\\":[{\\"t\\":\\"preview\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_201,h_201,q_75,strp\\\\u002F\\\\u003CprettyName\\\\u003E-fullview.jpg\\",\\"h\\":201,\\"w\\":201,\\"f\\":7637},{\\"t\\":\\"social_preview\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_201,h_201,q_75,strp\\\\u002F\\\\u003CprettyName\\\\u003E-fullview.jpg\\",\\"h\\":201,\\"w\\":201}]},\\"textContent\\":{\\"excerpt\\":\\"Willow [Temp. Title]\\\\n\\\\nPreface\\\\n\\\\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;The world around us, its people. They are very much focused on the intake of information, of knowledge. Knowledge, be it that they bear the wisdom to misuse it or otherwise. It is most interesting. Nonetheless, imagine, for a moment. Imagine that the world and its people grew to this day not dwelling primarily upon curiosity, on knowledge of the world around us; on what we can give to the mind. But rather, on the power of the mind, on the mysteries of self. On what the mind can do. What it can be.\\\\n\\\\n-----\\\\n\\\\nThird Book of Storm - Final Chapter\\\\n\\\\nEpiphany\\\\n\\\\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Everything was dark.\\\\n\\\\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\\\\\\"Ar\\",\\"html\\":{\\"type\\":\\"writer\\",\\"features\\":\\"\\"}},\\"entityId\\":468568},\\"480183\\":{\\"deviationId\\":480183,\\"typeId\\":1,\\"printId\\":null,\\"url\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fpachunka\\\\u002Fart\\\\u002FLove-480183\\",\\"title\\":\\"Love\\",\\"isJournal\\":false,\\"isPurchasable\\":false,\\"publishedTime\\":\\"2002-07-05T13:42:31-0700\\",\\"isTextEditable\\":false,\\"legacyTextEditUrl\\":null,\\"isShareable\\":true,\\"isCommentable\\":true,\\"isFavourited\\":false,\\"isDeleted\\":false,\\"isMature\\":false,\\"isDownloadable\\":true,\\"isAntisocial\\":false,\\"isBlocked\\":false,\\"isPublished\\":true,\\"blockReason\\":null,\\"author\\":114790,\\"stats\\":{\\"comments\\":6,\\"favourites\\":2},\\"media\\":{\\"baseUri\\":\\"https:\\\\u002F\\\\u002Fimages-wixmp-ed30a86b8c4ca887773594c2.wixmp.com\\\\u002Ff