\\\nGreen\\",\\"html\\":{\\"type\\":\\"writer\\",\\"features\\":\\"\\"}},\\"entityId\\":487201},\\"515545\\":{\\"deviationId\\":515545,\\"typeId\\":1,\\"printId\\":null,\\"url\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fpachunka\\\\u002Fart\\\\u002FMibanjo-Song-515545\\",\\"title\\":\\"Mibanjo Song\\",\\"isJournal\\":false,\\"isPurchasable\\":false,\\"publishedTime\\":\\"2002-07-16T17:31:42-0700\\",\\"isTextEditable\\":false,\\"legacyTextEditUrl\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fdeviation\\\\u002Fedit\\\\u002F515545\\",\\"isShareable\\":true,\\"isCommentable\\":true,\\"isFavourited\\":false,\\"isDeleted\\":false,\\"isMature\\":false,\\"isDownloadable\\":false,\\"isAntisocial\\":false,\\"isBlocked\\":false,\\"isPublished\\":true,\\"blockReason\\":null,\\"author\\":114790,\\"stats\\":{\\"comments\\":9,\\"favourites\\":1},\\"media\\":{\\"baseUri\\":\\"https:\\\\u002F\\\\u002Fimages-wixmp-ed30a86b8c4ca887773594c2.wixmp.com\\\\u002Fi\\\\u002F2b5a457d-dde7-459a-badf-774e8e506025\\\\u002Fdb1sp-30980703-f79b-40d9-99d4-37c4c42bfb47.gif\\",\\"types\\":[{\\"t\\":\\"preview\\",\\"r\\":-1,\\"h\\":158,\\"w\\":188,\\"f\\":15322},{\\"t\\":\\"social_preview\\",\\"r\\":-1,\\"h\\":158,\\"w\\":188}]},\\"textContent\\":{\\"excerpt\\":\\"M\'Banjo Song\\\\n\\\\nWell I woke up this mornin\'\\\\nAnd I looked outside,\\\\nAnd there was funk\\\\nAll over my lawn..\\\\n\\\\nYes sir ah saw me a blindman\\\\nWith a crazy hat,\\\\nMakin\' a phone\\\\nCall over my lawn..\\\\n\\\\nWell I said- \\\\\\"Hey\\\\\\"\\\\nAnd \'e said- \\\\\\"Ho tay\\\\\\"\\\\nAnd he asked, \\\\\\"What manner of funk?\\\\\\"\\\\n\\\\nAnd I said \\\\\\"Yo, brotha\'!\\\\nBut surely you know, of the sky\'s\\\\nPulmonary trunk?\\\\\\"\\\\n\\\\nBut..\\\\n\\\\nHe looked at me and said, \\\\\\"I thought it was the clavi..\\\\\\"\\\\nAnd I saw confusion consume his eyes..\\\\nSo I produced my banjo..\\\\nAnd song began to fly..\\\\n\\\\nAn\' I said-\\\\n\\\\nO!\\\\n\\\\nYe Banjo man, with the fun-ky scarf\'n\'hat,\\\\n\\\\nI said O!\\\\n\\\\nThere\'s funk alright, and crazy funk at that..\\\\n\\\\nThere\'s funk,\\\\nComin\'\\",\\"html\\":{\\"type\\":\\"writer\\",\\"features\\":\\"\\"}},\\"entityId\\":515545},\\"531350\\":{\\"deviationId\\":531350,\\"typeId\\":1,\\"printId\\":null,\\"url\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fpachunka\\\\u002Fart\\\\u002FAll-531350\\",\\"title\\":\\"All\\",\\"isJournal\\":false,\\"isPurchasable\\":false,\\"publishedTime\\":\\"2002-07-21T20:02:21-0700\\",\\"isTextEditable\\":false,\\"legacyTextEditUrl\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fdeviation\\\\u002Fedit\\\\u002F531350\\",\\"isShareable\\":true,\\"isCommentable\\":true,\\"isFavourited\\":false,\\"isDeleted\\":false,\\"isMature\\":false,\\"isDownloadable\\":false,\\"isAntisocial\\":false,\\"isBlocked\\":false,\\"isPublished\\":true,\\"blockReason\\":null,\\"author\\":114790,\\"stats\\":{\\"comments\\":20,\\"favourites\\":9},\\"media\\":{\\"baseUri\\":\\"https:\\\\u002F\\\\u002Fimages-wixmp-ed30a86b8c4ca887773594c2.wixmp.com\\\\u002Fi\\\\u002F2b5a457d-dde7-459a-badf-774e8e506025\\\\u002Fdbdzq-743e73c7-54a7-469d-beec-5e673b9cd0d7.jpg\\",\\"prettyName\\":\\"all_by_pachunka_dbdzq\\",\\"types\\":[{\\"t\\":\\"preview\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_287,h_235,q_75,strp\\\\u002F\\\\u003CprettyName\\\\u003E-fullview.jpg\\",\\"h\\":235,\\"w\\":287,\\"f\\":8923},{\\"t\\":\\"social_preview\\",\\"r\\":-1,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_287,h_235,q_75,strp\\\\u002F\\\\u003CprettyName\\\\u003E-fullview.jpg\\",\\"h\\":235,\\"w\\":287}]},\\"textContent\\":{\\"excerpt\\":\\"\\u00A0\\\\nAll\\\\n\\\\nAll that I want isn\'t here with me,\\\\nYet all that is here is my essence-\\\\nAll that I see now, is all that is left,\\\\nAnd all that is left is my presence..\\\\n\\\\nAll of the buskers and gods of my town,\\\\nAnd all of the time in the world-\\\\nEach one is taken, and taken aback,\\\\nAs the time that is left unfurled.\\\\n\\\\nThe time that was God to the physicist,\\\\nThe time that was life to the crop,\\\\nThe time that was joy to the child of all ages-\\\\nThat time\\\\nIs soon going\\\\nTo stop.\\\\n\\\\nAnd all that I want isn\'t here with me,\\\\nYet what\'s here is the answer to all my life\'s thoughts,\\\\nAnd all that I see now, is all that left,\\\\nYet so much still remains to be s\\",\\"html\\":{\\"type\\":\\"writer\\",\\"features\\":\\"\\"}},\\"entityId\\":531350},\\"145564099\\":{\\"deviationId\\":145564099,\\"typeId\\":1,\\"printId\\":null,\\"url\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fpachunka\\\\u002Fart\\\\u002FCope-145564099\\",\\"title\\":\\"Cope\\",\\"isJournal\\":false,\\"isPurchasable\\":false,\\"publishedTime\\":\\"2009-12-02T23:59:51-0800\\",\\"isTextEditable\\":false,\\"legacyTextEditUrl\\":null,\\"isShareable\\":true,\\"isCommentable\\":true,\\"isFavourited\\":false,\\"isDeleted\\":false,\\"isMature\\":false,\\"isDownloadable\\":true,\\"isAntisocial\\":false,\\"isBlocked\\":false,\\"isPublished\\":true,\\"blockReason\\":null,\\"author\\":114790,\\"stats\\":{\\"comments\\":5,\\"favourites\\":6},\\"media\\":{\\"baseUri\\":\\"https:\\\\u002F\\\\u002Fimages-wixmp-ed30a86b8c4ca887773594c2.wixmp.com\\\\u002Ff\\\\u002F2b5a457d-dde7-459a-badf-774e8e506025\\\\u002Fd2enxz7-431ca9c3-987f-4b2d-ae6a-cbbdd1c0e2bf.jpg\\",\\"prettyName\\":\\"cope_by_pachunka_d2enxz7\\",\\"token\\":[\\"eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..IgIuTtYswRRSrLcUD8alCdW0sAgmkVTiQAjV5-OCfv8\\",\\"eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..pCEF4M_tMVZI92ZKClZdcMu5UqpQ3131DrHsx1WxefY\\"],\\"types\\":[{\\"t\\":\\"150\\",\\"r\\":0,\\"c\\":\\"v1\\\\u002Ffit\\\\u002Fw_150,h_150,q_70,strp\\\\u002F\\\\u003CprettyName\\\\u003E-150.jpg\\",\\"h\\":150,\\"w\\":100},{\\"t\\":\\"200H\\",\\"r\\":0,\\"c\\":\\"v1\\\\u002Ffill\\\\u002Fw_133,h_200,q_70,strp\\\\u002F\\\\u003CprettyName\\\\u003E-200h.jpg\\",\\"h\\":200,\\"w\\":133},{\\"t\\":\\"300W\\",\\"r\\":0,\\"c\\":\\"v1\\\\u002Ffit\\\\u002Fw_300,h_67